import { Image } from "./../interfaces/image";

type Props = {
  url: Image;
};

const ImagePage = ({ url }: Props) => {
  return <div>{url}</div>;
};

export async function getServerSideProps({ query }) {
  return {
    props: {
      url: query.id,
    },
  };
}

export default ImagePage;
